import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Adminresister from "./Adminresister";
import Adminlogin from "./Adminlogin";
import Customerresister from "./Customerresister";
import Customerlogin from "./Customerlogin";
import Effect6 from "./immage/Effect6.jpg";

export default function App() {
  return (
    <Router>
      <div>


style={{
        backgroundImage: `url(${Effect6})`,
        backgroundSize: "cover",
        backgroundPosition: "center",
        height: "100vh",
        width: "100vw",
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-start",
        alignItems: "center",
        color: "white",
        textShadow: "2px 2px 4px rgba(0, 0, 0, 0.7)",
      }}


        {/* Navigation links */}
        <nav>
          <ul>
            <li>
              <Link to="/Adminresister">Go to Admin Register</Link>
            </li>
            <li>
              <Link to="/Adminlogin">Go to Admin Login</Link>
            </li>
            <li>
              <Link to="/Customerresister">Go to Customer Register</Link>
            </li>
            <li>
              <Link to="/Customerlogin">Go to Customer Login</Link>
            </li>
          </ul>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/Adminresister" element={<Adminresister />} />
          <Route path="/Adminlogin" element={<Adminlogin />} />
          <Route path="/Customerresister" element={<Customerresister />} />
          <Route path="/Customerlogin" element={<Customerlogin />} />
          <Route path="/" element={<Adminresister />} /> {/* Default route */}
        </Routes>
      </div>
    </Router>
  );
}
